import styled from 'styled-components'

function AdminSidebar (props) {
    return(
        <SidebarWrapper>
            <ul>
                <sbTitle>ADMIN</sbTitle>
            </ul>
        </SidebarWrapper>
    );
}

const SidebarWrapper = styled.div`
    height: 100vh;
    width: 15vw;
    z-index: 5;
    background-color: #111;
    position: fixed;
    display: flex;
`;

export default AdminSidebar;
